import React from "react";
import '../styles/thanksmessage.css';

const ThanksMessage = () => {
  return (
    <div className="thanks-message">
      <h1>Thank you for sending your email! I will message you soon.</h1>
    </div>
  );
};

export default ThanksMessage;
